script: |
  super -f text -I q277.spq | sort > q277.out

inputs:
  - name: q277.spq
    data: |
      SELECT col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( col2 ) BETWEEN col0 AND ( - cor0.col1 + col2 ) OR NOT - cor0.col2 + col1 * col1 + - col1 NOT BETWEEN col2 AND ( NULL );
  - name: tab2

outputs:
  - name: q277.out
    data: |
      17
      31
      59
